import logo from '../../static/KPMG_logo_white.svg';
import upload_icon from '../../static/upload.png';
import React from 'react';

import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    button: {
        margin: theme.spacing(1),
    },
    input: {
        display: 'none',
    },
}));

export default function UploadBar() {
    const classes = useStyles();

    return (
        <div className='uploadbar_container'>
            <img src={logo} alt='kpmg_logo' style={{ width: '80px', float: 'left' }} />
            <input accept="*" className={classes.input} id="upload-btn" multiple type="file" />
            <label htmlFor="upload-btn"><button id='upload_btn'><img src={upload_icon} style={{width: '50px'}} alt='upload'/></button></label>
        </div>
    );
};
